import React, { Component } from "react";
import ListItem from './ListItem.jsx';
import './App.css';

export default class List extends Component {
    render() {
        const pieces = [
            ["Harold Parker Forest", "/images/Piece1.jpg", "oil paint", "08/2017", ""],
            ["Black Cloud", "/images/Piece2.jpg", "colored pencil", "3/2016", "Scholastic Art and Writing Awards National Gold Medal + Scholastic Art and Writing Awards Regional Gold Medal"],
            ["Serenity", "/images/Piece3.jpg", "watercolor", "05/2018", ""],
            ["Frosted Pink", "/images/Piece4.jpg", "colored pencil", "02/2014", ""],
            ["The Unexpected Adventure", "/images/Piece5.jpg", "colored pencil", "11/2015", ""],
            ["Offstage", "/images/Piece6.jpg", "colored pencil", "08/2016", "Scholastic Art and Writing Awards Regional Silver Medal"],
            ["Flash of Life", "/images/Piece7.jpg", "colored pencil", "09/2017", ""],
            ["Red", "/images/Piece8.jpg", "ink", "12/2016", ""],
            ["*Untitled*", "/images/Piece9.jpg", "collage", "10/2019", ""],
            ["Moving Forward", "/images/Piece10.jpg", "oil paint", "6/2016", ""],
            ["Autumn Farmhouse", "/images/Piece11.jpg", "oil paint", "7/2016", ""],
            ["Cornucopia", "/images/Piece12.jpg", "Mixed Media", "10/2016", "Scholastic Art and Writing Awards Regional Gold Medal"]
        ];
        const listpiece = pieces.map((piece) =>
            <ListItem name={piece[0]} src={piece[1]} medium={piece[2]} />
        );
        return <div>{listpiece}</div>;
    }
}
